import React from 'react';
import './App.css';
import {
  BrowserRouter as Router,
  Route,
} from "react-router-dom";

import solicitudService from './components/services/solicitudService';
import Solicitud from './components/Solicitud.js'
import Reserva from './components/Reserva.js'

import 'bootstrap/dist/css/bootstrap.min.css';



class App extends React.Component {
  constructor(props){
    super(props);
    this.state = ({listarut:""});
    this.obtener = this.obtener.bind(this)
}

  obtener(){
    solicitudService.getAll()
    .then(res=>{this.res = res.data;
      var lista = res.data;
      this.setState({listarut:lista});
    });
  }
  componentWillMount(){
    this.obtener()
  }
  render(){

  

  return (
    <div className = "App">
    <Router>
      <Route path="/solicitud">
      <Solicitud listarut = {this.state.listarut}/>
      </Route>
      <Route path="/reserva">
      <Reserva />
      </Route>
    </Router>
  </div>
         
        
  )}
    }
export default App;
